#   https://leetcode.com/problems/valid-palindrome-ii


class Solution:
    def isPalindrome(self, s):
        return s == s[::-1]

    #   Wrong Answer
    def validPalindrome0(self, s):
        if s is None or 0 == len(s):
            return False

        if self.isPalindrome(s):
            return True

        charIdxDict = {}
        for i, c in enumerate(s):
            if c in charIdxDict:
                charIdxDict[c].append(i)
            else:
                charIdxDict[c] = [i]

        for c, indices in charIdxDict.items():
            if 0 == len(indices) % 2:
                continue
            for idx in indices:
                if self.isPalindrome(s[:idx] + s[idx + 1:]):
                    return True
        return False

    #   Wrong Answer
    def validPalindrome1(self, s):
        if s is None or 0 == len(s):
            return False

        if self.isPalindrome(s):
            return True

        l, r = 0, len(s) - 1
        while l < r:
            if s[l] != s[r]:
                #   delete s[r]
                if self.isPalindrome(s[l:r]):
                    return True
                #   delete s[l]
                if self.isPalindrome(s[l + 1:r + 1]):
                    return True
            l += 1
            r -= 1
        return False

    #    Time Limit Exceeded
    def validPalindrome2(self, s):
        if s is None or 0 == len(s):
            return False

        if self.isPalindrome(s):
            return True

        l, r = 0, len(s) - 1
        while s[l] == s[r]:
            l += 1
            r -= 1
        for i in range(l, r + 1):
            if self.isPalindrome(s[:i] + s[i + 1:]):
                return True
        return False

    #   Time Limit Exceeded
    def validPalindrome3(self, s):
        if s is None or 0 == len(s):
            return False

        if self.isPalindrome(s):
            return True

        l, r = 0, len(s) - 1
        while s[l] == s[r]:
            l += 1
            r -= 1
        ll, rr = l, r
        while ll < rr:
            if s[ll] != s[rr]:
                #   delete s[rr]
                if self.isPalindrome(s[:rr] + s[rr + 1:]):
                    return True
                #   delete s[ll]
                if self.isPalindrome(s[:ll] + s[ll + 1:]):
                    return True
            ll += 1
            rr -= 1
        return False

    #   Time Limit Exceeded
    def validPalindrome4(self, s):
        if s is None or 0 == len(s):
            return False

        if self.isPalindrome(s):
            return True

        charIdxDict = {}
        for i, c in enumerate(s):
            if c in charIdxDict:
                charIdxDict[c].append(i)
            else:
                charIdxDict[c] = [i]

        oddCharCount = 0
        for c, indices in charIdxDict.items():
            lenIndices = len(indices)
            if 0 == lenIndices % 2:
                continue
            oddCharCount += 1
            for i in indices:
                if self.isPalindrome(s[:i] + s[i + 1:]):
                    return True
        if 1 < oddCharCount:
            return False

        for c, indices in charIdxDict.items():
            lenIndices = len(indices)
            if 1 == lenIndices % 2:
                continue
            for i in indices:
                if self.isPalindrome(s[:i] + s[i + 1:]):
                    return True

        return False

    #   https://leetcode.com/problems/valid-palindrome-ii/solution
    def validPalindromeSol(self, s):
        def is_pali_range(i, j):
            return all(s[k] == s[j - k + i] for k in range(i, j))

        for i in range(len(s) // 2):
            if s[i] != s[~i]:
                j = len(s) - 1 - i
                return is_pali_range(i + 1, j) or is_pali_range(i, j - 1)
        return True

    #   64.86%
    def validPalindrome(self, s):
        l, r = 0, len(s) - 1
        while l < r and s[l] == s[r]:
            l += 1
            r -= 1

        def isPalindrome(s):
            return s == s[::-1]

        return isPalindrome(s[l:r]) or isPalindrome(s[l + 1:r + 1])


solution = Solution()
data = [('aba', True),
        ('abca', True), #   palindrome deleting 'c'
        ('eedede', True),
        ('cxcaac', False),
        ('cbbbcg', True),
        ('cuelnbtbyyjddhfcbsfzdvdvpckqqovpdaastcxmbkkdaxznuljlunzxadkkbmxctsaadpvoqqkcpvdvdzfsbcfhddjyybhtbnleuc', True),
        ('', True),
        ('', False),
        ('', False),
        ]
for s, expected in data:
    real = solution.validPalindrome(s)
    if len(s) < 10:
        print('{}, expected {}, real {}, result {}'.format(s, expected, real, expected == real))
    else:
        print('{}...({}), expected {}, real {}, result {}'.format(s[:10], len(s), expected, real, expected == real))
